import { types } from "./type";

export function registerUser(user) {
    return {
      type: types.REGISTRATION_REQUEST,
      payload: user,
    };
  }
  
  export function registerFailed() {
    return {
      type: types.REGISTRATION_FAILURE,
    };
  }
  
  export function registerSuccess() {
    return {
      type: types.REGISTRATION_FAILURE,
    };
  }
